text:
 @Imperadorfreeza-j3m  

A torcida do Flamengo dês da queda da raça rubro negra vem cantando 90 minutos todo jogo até o setor leste da Flaleblon, mas como agora a narradora deu atenção a torcida coisa que outros não faziam quando faziam diziam "as duas torcidas estão cantando" tipo Gustavo villane.

Aí todo mundo elogia parem de cair no papo da mídia e de anti dês de que a raça rubro negra caiu, a Fla manguaça e a torcida jovem Tão cantando 90 minutos até depois de tomar o gol e por aí vai.
